import {
    CHANGE_LOGIN_EMAIL,
    CHANGE_LOGIN_PASSWORD,
} from './types'

// criar acoes

export const changeLoginEmail = (email) => {
    return {
      type: CHANGE_LOGIN_EMAIL,
      payload: email
    };
  };

  export const changeLoginPassword = (password) => {
    return {
      type: CHANGE_LOGIN_PASSWORD,
      payload: password
    }
  };
